CREATE TABLE Tests (
	`String` STRING(MAX) NOT NULL,
	`Bytes` BYTES(4) NOT NULL,
	`Int64` INT64 NOT NULL,
	`Float64` FLOAT64 NOT NULL,
	`Numeric` NUMERIC NOT NULL,
	`Bool` BOOL NOT NULL,
	`Date` DATE NOT NULL,
	`Timestamp` TIMESTAMP NOT NULL,
	`NullString` STRING(MAX),
	`NullInt64` INT64,
	`NullFloat64` FLOAT64,
	`NullNumeric` NUMERIC,
	`NullBool` BOOL,
	`NullDate` DATE,
	`NullTimestamp` TIMESTAMP,
	ArrayString ARRAY<STRING(MAX)>,
	ArrayBytes ARRAY<BYTES(4)>,
	ArrayInt64 ARRAY<INT64>,
	ArrayFloat64 ARRAY<FLOAT64>,
	ArrayNumeric ARRAY<NUMERIC>,
	ArrayBool ARRAY<BOOL>,
	ArrayDate ARRAY<DATE>,
	ArrayTimestamp ARRAY<TIMESTAMP>,
) PRIMARY KEY (`String`, `Int64`)
